import React from "react"

class MemeImage extends React.Component {
  constructor() {
    super()
  }
  render(){
    console.log(this.props)
    return(
      <div>
      <img src={this.props.memeImages[this.props.counter].url}/>
      </div>
    )
  }
}

export default MemeImage
